                'description' => '{"en":"<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Quisque commodo augue vel dui cursus, non luctus urna congue. Vestibulum ut ultricies tortor. Sed eu libero nec ex tristique fringilla. Pellentesque habitant morbi tristique senectus et netus et malesuada fames ac turpis egestas. In vitae magna eu justo lacinia feugiat. Duis auctor vulputate quam, sit amet tincidunt ipsum consequat ut. Curabitur eu risus vitae neque posuere cursus ut ut quam. Integer tempor risus non dolor luctus, eget accumsan nisl eleifend. Fusce venenatis nulla non lacus tincidunt, ut sollicitudin libero mollis</p>","hi":"<p>लोरेम इप्सम डॉलर सिट अमेत, कॉन्सेक्टेतुर एडिपिसिंग एलिट। क्विस्कुए कोमोदो औगुए वेल दुइ कुर्सुस, नोन लुक्तुस उर्ना कोंगुए। वेस्तिबुलुम उत उल्त्रिस टोर्तोर। सेद एऊ लिबेरो नेक एक्स त्रिस्तिक्तुस फ्रिंगिल्ला। पेल्लेन्तेस्क्वेह हबितंत मोर्बि त्रिस्तिक्तुए सेनेक्तुस एत नेतुस एत मालेसुआदा फामेस एक तुर्पिस एगेस्तस। इन विताए मग्ना एऊ जुस्तो लाचिनिया फेऊगियात। दुइस औक्तोर वुल्पुतते क्वाम, सित अमेत तिंचिदुन्त इप्सुम क्वाम कोंसेक्वातू उत। कुरबितुर एऊ रिसुस विताए नेक्वे पोसुएरे कुर्सुस उत उत क्वाम। इंटेजर तेम्पोर रिसुस नोन डोलोर लुक्तुस, एगेत अक्कुम्सन निस्ल एलेइफेंद। फुस्के वेनेनातिस नुल्ला नोन लाकुस तिंचिदुन्त, उत सोल्लिसितुदिन लिबेरो मोल्लिस।</p>","ar":"<p>لوريم إيبسوم دولور سيت أميت، كونسيكتيتور أديبيسينغ إليت. كويسكو كومودو أوغوي فيل دوي كورسوس، نون لوكتوس أورنا كونغو. فيستيبولوم أوت ألتريس تورتور. سيد أو ليبرو نيك إكس تريستيكو فرينجيلا. بيلينتيسكوي حابيتانت موربي تريستيكوي سينيكتوس إت نيتوس إت ماليسوادا فاميس أك توربيس إجستاس. إن فيتاي ماغنا أو جوستو لاسينيا فيوغيات. دويس أوكتور فولبوتاتي كوام، سيت أميت تينسيدونت إبسوم كونسيكوات أوت. كورابيتور أو ريسوس فيتاي نيكوي بوسويري كورسوس أوت أوت كوام. إنتيجير تيمبور ريسوس نون دولور لوكتوس، إيجيت أكومسان نيسل إليفيند. فوسكي فينيناتيس نولا نون لاكوس تينسيدونت، أوت سوليسيتودين ليبرو موليس.</p>"}',
